@nuramaliafitriani poligami memang diperbolehkan tapi sangat diatur dalam agama dan diberi contoh oleh Rasul apa itu poligami (bukan karna hawa nafsu menghindari zinah). Selama bersama siti Khadijah, Rasul tidak pernah mendua, sampai Siti Khadijah tiada, Rasul menduda dulu baru di usia 51 tahun Rasul menikahi janda janda lansia, budak yang di merdekakan, dan janda banyak anak. Berikut istri istri Nabi setelah Khadijah wafat dan setelah menikahi Aisyah, yaitu Saudah binti Zam‚Äôah, seorang janda berusia 70 tahun dengan 12 orang anak. Setelah dari Saudah, Rasulullah kembali menikah dengan¬†Zainab binti Jahsyi, janda berusia 45 tahun, lalu dengan¬†Ummu Salamah (janda berusia 62 tahun). Di saat berusia 57 tahun, Rasulullah kembali menikahi¬†Ummu Habibah (janda 47 tahun), dan¬†Juwairiyah binti Al-Harits (janda berusia 65 tahun dengan telah punya 17 anak).
Setahuh kemudian Rasulullah kembali menikahi¬†Shafiyah binti Hayyi Akhtab (janda berusia 53 tahun dengan 10 orang anak), Maimunah binti Al-Harits (anda berusia 63 tahun), dan¬†Zainab binti Harits (Janda 50 tahun yang banyak memelihara anak-anak yatim dan orang-orang lemah).
Setahun kemudian, Rasulullah menikah lagi dengan¬†Mariyah binti Al-Kibtiyah (gadis 25 tahun yang dimerdekakan), lalu¬†Hafshah binti Umar bin Khattab (janda 35 tahun, Rasulullah berusia 61 tahun), dan¬†ketika berusia 61 tahun itulah Rasulullah baru menyempurnakan pernikahannya dengan Aisyah, saat mereka telah hijrah ke Madinah. Beda jauuuuhh sekali dengan praktik poligami yang dilakukan oleh manusia manusia akhir zaman. Rasul adalah sebaik baiknya suri tauladan manusia.
